/* eslint-disable */

let join = '';
const hypen = '-';

const cleanSet = (set, startString) => {
	for (const string of set) {
		if (string.startsWith(startString)) {
			const newString = string.slice(startString.length);
			join.concat(newString);
			join.concat(hypen);
		}
	};
}

export default cleanSet;
